import React, { StrictMode } from "react";
import ReactDOM from "react-dom/client";
import User from "./User";
import './index.css'


ReactDOM.createRoot(document.getElementById("root")).render(
    <StrictMode>
     <>
     <div className="row">
     <User {...User[0]}/>
     <User />
     <User />
     </div>
     </> 
    </StrictMode>
  );
